{"query":"query useSearchOrders{
  ordersOrderSearchOrder{
    nodes {
      ...OrderFragment
    }
    totalCount
  }
}

fragment OrderFragment on ElasticOrder {
  id
  orderDate
  number
  total
  paymentType
  trackingCode
  trackingUrl
  shipmentStatus {
    date
    kind
  }
  currentStatus
  orderStatus {
    kind
    date
  }
  currentPaymentStatus
  paymentStatus {
    kind
    date
  }
  buyer {
    ...UserInterfaceFragment
  }
  shippingAddress {
    ...AddressFragment
  }
  orderItems {
    item {
      ...ProductFragment
    }
  }
}

fragment ProductFragment on ElasticProduct {
  id
  name
  price
  paymentStatus {
    kind
    date
  }
  barcode
  details
  images {
    imageUrl
  }
}

fragment UserInterfaceFragment on UserInterface {
  firstName
  lastName
  email
}

fragment AddressFragment on ShippingAddress {
  id
  kind
  address1
  address2
  city
  neighborhood
  number
  state
  zipcode
}
","operationName":"useSearchOrders"}

